    "Assets.Tab.Explain": "Explain",
    "Assets.Explain.text": "<div class='assetsInfo'><h2>Asset Management</h2><p>The Asset Management section allows you to create Assets types and define the Assets fields associated with that Assets type. You can add, edit and delete Assets fields from the website. You can also create custom job templates and update the Assets fields from within job steps on the mobile app. You can define triggers which cause jobs to be created based on certain events, such as an Assets requiring its next annual inspection.</p><b>Configure your assets</b><p>To get started with Asset management, you need Configure the Assets section to suit your needs, then you can start adding your assets. Click on Assets Config and follow these steps :</p><ul><li>Define the Assets Fields you require </li><li>Combine similar Assets Fields in to Assets Field Groups</li><li>Define Assets Types and select the Assets Fields that belong to that Assets Type</li><li>Define Assets Triggers which create jobs based on an event such as an inspection due date</li><li>Define Assets statuses such as Active, Inactive, etc</li><li>Add your individual assets, using either the Add Assets function or the Assets Uploader or the Assets API</li><li>Create Job templates for different Assets types</li></ul><h2>1. Assets Fields</h2><p>There are a number of default Assets Fields:</p><ul><li><b>Identifier</b> - unique identifier for your asset, can be an ID you type in or an RFID or Barcode number.</li><li><b>Name</b> – the name you give your asset</li><li><b>Status</b> – the status that you assign to your asset, such as Active or Inactive</li><li><b>Type</b> – define your Assets Types and select which Assets fields are required for each Assets type</li><li><b>Selling and cost price</b> – for each asset, if required, you can assign a Selling price and a cost price</li><li><b>Company</b> – for each asset, if required, you can select the Company that the Assets belongs to</li><li><b>Location</b> – for each Assets you can define its street address ( address line 1, address line 2, address line 3, Town/City, Postal Code, Country ) and its latitude and longitude ). </li></ul><p>You can add up to 200 additional custom Assets Fields. To add a new Assets field, click on Add Field, you will be presented with this popup :</p><div class='clear'></div><img class='image' src='assets/images/icons/assets/add_asset_fields.png' /><div class='clear'></div><p>Fill out the following:</p><ul><li><b>Name</b> – give the Assets field a name</li><li><b>Group</b> – select the group that this Assets field belongs to, or add a new group name ( more information on Assets Field Groups below)</li><li><b>Field format</b> – select the format of the Assets field. Available options are : Text, Note, List, Date, Date/Time, Time, Picture, Number, Email, Signature, Drawing, File</li><li><b>Default Value</b> – enter the default value for the Assets field </li><li><b>Option(s)</b> – if the Assets format is a list, this is where you enter the list options, comma separated.</li></ul><h2>2. Assets Field Groups</h2><p>Assets Field Groups are simply labels under which you can group similar Assets fields. For example, define an Assets Field Group for Financial fields, Warranty fields, Manufacturer Details fields, etc.</p><h2>3. Assets Types</h2><p>This is where you organize Assets Fields by Assets Types. You can create as many Assets Types as you need and assign up to 50 Assets Fields for each Assets Type. For example you could create an Assets Type of Boiler. You then define which Assets Fields are required by the Boiler Assets Type. To create a new Assets Type simply click on <b>Create An Assets Type</b>. Give the Assets Type a name and then click Create. You will then be presented with the screen below :</p><div class='clear'></div><img class='image' src='assets/images/icons/assets/asset_types.png' /><div class='clear'></div><p>Now select a Start Action – this allows you to define the action that is taken when the Assets is scanned by the mobile device. For example you can select Open Job List – this will show a list of Job Types available for this asset.</p><p>Now select the Assets Fields required by this Assets Type. Click on the Check box beside each Assets Field Group that you require. You can un-check any individual Assets Field that is not required.</p><p>Now select the Assets Triggers required by this Assets Type ( more information on Assets Triggers below ). Now click Save Assets Type.</p><h2>4. Triggers</h2><p>This is where you can create new triggers for your assets. Triggers cause jobs to be created at certain dates definable by you. For example you can trigger an Inspection Job when the Inspection Due date arrives. </p><div class='clear'></div><img class='image' src='assets/images/icons/assets/asset_triggers.png' /><div class='clear'></div><p>To add new trigger pick:</p><ul><li><b>Name</b> – give the trigger a name</li><li><b>Job Template</b> – select the job that will be run when trigger occurs</li><li><b>Updated Assets Status</b> - new status that will be assigned to Assets after the trigger occurs</li><li><b>Trigger job time</b> – the time interval from the Assets creation date to the trigger date</li><li><b>Advance time</b> – the length of time before the trigger time that the job is created</li></ul><h2>5. Assets Statuses</h2><p>There are two Assets Status Types – Active and Inactive.<br />In this section, you can create a number of aliases for Active and Inactive – eg : In Service, Available (Active) and Out of Service, Unavailable (Inactive).</p><h2>6. Add your Assets</h2><p>Now that you have configured your Assets Management section, you can upload your individual assets. You can upload assets manually, one at a time, by clicking on the Assets Management Tab and click on Add An Asset. You can also upload your assets in a batch from a spreadsheet. Click on Assets Management, then click on Upload Assets. Now download the Assets Upload Template. Fill out this template with your Assets and then click on Chose file, select your Assets file and then click on Upload. Once you add your assets you will see them listed in the Assets Management section – where you can edit any Assets field as required.</p><h2>7. Create Assets Jobs</h2><p>This is where the Assets Management section integrates with the Job scheduling and dispatch section. You can associate Job Templates with Assets Types. When these jobs are being completed on a mobile device, the data entered on  individual job steps can update the appropriate Assets Fields. For example, a 'Get Latitude and Longitude' job step, can update the Latitude and Longitude of the assets.</p><p>To associate a Job Template with an Assets Type, simply select the Assets Type from the drop down list highlighted in red below.</p><div class='clear'></div><img class='image' src='assets/images/icons/assets/job_templates1.png' /><div class='clear'></div><p>You will see on the Job Workflow steps a new dropdown list. This allows you to select the Assets Field to update from the job step.In the example below, step 4, 'Get Latitude and Longitude' will update the Latitude and Longitude Field of the Asset. The job steps can only update similar Assets Fields, for example 'Get Picture' can only update the Assets Picture field and not, for example, the Assets Name field.</p><div class='clear'></div><img class='image' src='assets/images/icons/assets/job_templates2.png' /><div class='clear'></div></div>",
