    "VideoRelayConfig.ExplainText": "<div class='assetsInfo'><h2>Video Relay</h2><p>The Video Relay service allows you to start a video call from the web app to the mobile app (Currently, this feature is only supported on Android devices). Also, optionally, you can record the call, invite additional users into the ongoing call, and put down some related notes during or after the call.</p><h2>1.: Configuration</h2><p>Once the Video Relay service has been enabled for you, you can start using the feature without any additional configuration. However, if you also want to take notes, you will need to set up some fields to do so.</p><p>You can do this by clicking the <b>Fields</b> tab on the <b>Video Relay Config</b> page. You can add a new field by clicking the <b>Add Field</b> button in the top left corner of the list here.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-config-add-field.png'/><div class='clear'></div><p>Each and every field you add to this list will be displayed on the Video Relay page, on the right, during and after a call. This allows you to take notes on different details of a call. It is important to note, that putting in call notes is only possible in the web app - the mobile side does not have this option.</p><h2>2.: Create A Video Relay Call</h2><p>First of all, please note that, each user can participate in one - and <i>only</i> one - Video Relay call at a time. You cannot create create a Video Relay to a user who is already in an ongoing call.</p><p>There are two ways to initiate a Video Relay call:<ul><li>from the <b>Custom Jobs Dashboard</b> page (Navigate to [Dashboard > Jobs] in the main menu) - in this case, the related Job will also be bound to the Video Relay</li><li>from the <b>Video Relay</b> page (Navigate to [Video Relay] in the main menu)</li></ul></p><p>To start a call <b>from the Custom Jobs Dashboard page</b>, simply click on the green icon next to the name in the Assigned To column. A green icon indicates that a user is ready to accept a call, and a red icon indicates that the user is participating in an ongoing call. Once you have clicked the icon, you will be brought to the Video Relay page and joined the call. If you already have an ongoing Video Relay call that you are invited to, you will not be allowed to start a new one, and will be joined the ongoing call instead.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-custom-jobs-camera.png'/><div class='clear'></div><p>To start a call <b>from the Video Relay page</b>, simply click the Make A Call button. You will be presented with a list of users to chose a callee from. You can confirm your selection either by clicking the Select button at the bottom of the list, or by double clicking the name of the selected user in the list.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-select-employee.png'/><div class='clear'></div><p>Whichever way you start the Video Relay call, you will be presented with the below layout.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-main-screen.png' style='max-width:1000px;'/><div class='clear'></div><p>Please note that <b>the first time you participate in a call, your browser will request access to your web camera</b>. You only have to authorize this once, the next time you visit this page your browser will remember the setting you chose.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-authorize-camera.png'/><div class='clear'></div><h2>3.: Call Time Out</h2><p>While you wait for your call to be answered, a dialog box will appear with the option to Cancel your call. If you do not do so, and there is no response from the callee, the call will time out in one minute.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-calling-user.png'/><div class='clear'></div><h2>4.: Recording</h2><p>By default, recording is off in a call. You can turn it on by clicking the Start Recording button in the bottom left corner of the Video Relay page (your call will need to have been answered). Once the recording has been started, a message will appear in the logs in the bottom middle section of the page, and the same button you have used to start the recording can be used to stop it.</p><p>You will only be able to make one recording at a time, and that will contain all the video streams that are currently in the call. You can stop and restart recording as many times as you want, as long as the Video Relay call is active.</p><p>You can access your recorded files in the Video Relay Reports section. (See description on Video Relay Reports below.)</p><h2>5.: Invite Users To Join The Call</h2><p>Once the Video Relay has been established, you can invite other people in the call, by clicking the Invite Participant button in the bottom left corner of the Video Relay page, and selecting the user from the list. Once the user has been added to the call, you will see a new log entry about it. The invited user’s video stream will show up on the screen as soon as he navigates to the Video Relay page.</p><p>You can have a <b>maximum of 5 users</b> in a call at a time.</p><h2>6.: Call Notes</h2><p>You can take related notes during or after a Video Relay call. Once a Video Relay call has been established, you will see the fields you have configured appear in the form on the right. After the call has ended, you will not be able to change these notes once you have navigated away from the page, but you will be able to edit them for as long as you do not start a new call.</p><p>You can review the notes for each call in the Video Relay Reports section. (See description on Video Relay Reports below.)</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-in-call.png' style='max-width:1000px;'/><div class='clear'></div><h2>7.: Video Relay Reports</h2><p>You can find a list of all Video Relays in the Video Relay Reports section. (Navigate to [Video Relay > Video Relay Reports] in the main menu). To view detailed information on a Video Relay, simply double click on it in the list. </p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-reports.png' style='max-width:1000px;'/><div class='clear'></div><p>A window with the details will pop up. This window contains information on the Video Relay, the related Job’s identifier, the notes taken, the list of participants, and a list of recorded files, along with download links to each of them.</p><div class='clear'></div><img class='image' src='assets/images/videorelay/vr-report-details.png'/><div class='clear'></div></div>",
